  for (int i = 1; i <= internal->dim_number_IMod_GetHosp_NoOx; ++i) {
    internal->number_IMod_GetHosp_NoOx[i - 1] = (odin_sum1(internal->number_req_hosp_remaining, 0, internal->dim_number_req_hosp_remaining) <= 0 ? 0 : internal->number_req_hosp_remaining[i - 1] / (double) odin_sum1(internal->number_req_hosp_remaining, 0, internal->dim_number_req_hosp_remaining) * total_IMod_GetHosp_NoOx);
  }
  memcpy(output + 53, internal->n_IMod_GetHosp_GetOx_Die1, internal->dim_n_IMod_GetHosp_GetOx_Die1 * sizeof(double));
